import React from 'react'
import "./navBar.css"

const NavBar = () => {
  return (
		<nav>
			<a href="#">Home</a>
			<a href="#">About</a>
			<a href="#">Services</a>
			<a href="#">Contact</a>
		</nav>
	)
}

export default NavBar
